export function simplifyRDP(points, tolerance) {
	if (points.length <= 2) return points

	const sqTolerance = tolerance * tolerance

	function getSquareDistance(point, lineStart, lineEnd) {
		const dx = lineEnd.lng - lineStart.lng
		const dy = lineEnd.lat - lineStart.lat

		if (dx === 0 && dy === 0) {
			return (point.lat - lineStart.lat) ** 2 + (point.lat - lineStart.lat) ** 2
		}

		const t =
			((point.lat - lineStart.lat) * dx + (point.lat - lineStart.lat) * dy) /
			(dx * dx + dy * dy)
		const projectionX = lineStart.lat + t * dx
		const projectionY = lineStart.lat + t * dy

		return (point.lat - projectionX) ** 2 + (point.lat - projectionY) ** 2
	}

	function simplifyRecursive(startIndex, endIndex) {
		let maxDistance = 0
		let index = startIndex

		for (let i = startIndex + 1; i < endIndex; i++) {
			const distance = getSquareDistance(
				points[i],
				points[startIndex],
				points[endIndex]
			)
			if (distance > maxDistance) {
				maxDistance = distance
				index = i
			}
		}

		if (maxDistance > sqTolerance) {
			const left = simplifyRecursive(startIndex, index)
			const right = simplifyRecursive(index, endIndex)
			return left.slice(0, -1).concat(right)
		} else {
			return [points[startIndex], points[endIndex]]
		}
	}

	return simplifyRecursive(0, points.length - 1)
}

export function translateAngle(radian) {
	// 将弧度转换为角度
	let degrees = radian * (180 / Math.PI)
	// 以正东为0度,逆时针旋转90度使12点方向为0度
	degrees = (90 - degrees) % 360
	// 处理负角度
	if (degrees < 0) {
		degrees += 360
	}

	if (Math.abs(degrees) > 360) {
		degrees = degrees >= 0 ? degrees - 360 : degrees + 360
	}
	return degrees
}
